// src/components/Layout.jsx
import React from "react";
import { Link, Outlet, useLocation, useNavigate } from "react-router-dom";
import { RiUserLine, RiLogoutBoxRLine } from "react-icons/ri";
import { useAuth } from "../context/AuthContext";

/**
 * Smart Layout:
 * - Automatically hides its header/footer on pages that already render their own (Landing / Dashboard / Login / Register)
 * - Shows header/footer for KYC steps and other inner pages
 */

export default function Layout() {
  const { token, logout, user } = useAuth();
  const navigate = useNavigate();
  const loc = useLocation();
  const pathname = loc.pathname || "/";

  // Pages that already have their own header (do NOT show Layout header)
  const excludedPaths = ["/", "/login", "/register", "/dashboard"];

  const shouldHide = excludedPaths.includes(pathname);

  // debug log so you can verify what's happening
  // open browser console after loading a page and you'll see which layout branch is used
  // Remove or comment out console.log when done
  console.log("[Layout] pathname:", pathname, "hideLayoutHeader:", shouldHide);

  const handleLogout = () => {
    logout();
    navigate("/login");
  };

  return (
    <div className="min-h-screen flex flex-col bg-hdfc-gray">
      {/* If shouldHide is true, we only render the Outlet (page) without layout header/footer */}
      {shouldHide ? (
        <main className="flex-1 max-w-7xl w-full mx-auto px-6 py-8">
          <Outlet />
        </main>
      ) : (
        <>
          {/* Top blue strip */}
          <div className="h-2 bg-hdfc-blue"></div>

          {/* Header */}
          <header className="bg-white shadow-md border-b border-gray-100">
            <div className="max-w-7xl mx-auto px-6 py-4 flex justify-between items-center">
              <div className="flex items-center gap-3">
                <div className="h-10 w-10 rounded-md flex items-center justify-center bg-white shadow-card">
                  <div className="text-sm font-extrabold text-hdfc-blue">KYC</div>
                </div>
                <div>
                  <div className="text-xs text-gray-500">Digital Banking</div>
                  <div className="text-lg font-semibold text-gray-800">KYC Portal</div>
                </div>
              </div>

              <div className="flex items-center gap-4">
                <Link to="/" className="text-gray-600 hover:text-hdfc-blue font-medium">Home</Link>

                {token ? (
                  <>
                    <Link to="/dashboard" className="text-gray-600 hover:text-hdfc-blue font-medium">Dashboard</Link>
                    <div className="flex items-center gap-3">
                      <div className="hidden sm:flex items-center gap-2 text-sm text-slate-700">
                        <RiUserLine />
                        <span>{user?.name || user?.email || user?.kycId || "User"}</span>
                      </div>
                      <button onClick={handleLogout} className="flex items-center gap-2 btn-hdfc-outline">
                        <RiLogoutBoxRLine /> Logout
                      </button>
                    </div>
                  </>
                ) : (
                  <div className="flex items-center gap-3">
                    <Link to="/login" className="btn-hdfc-outline">Login</Link>
                    <Link to="/register" className="btn-hdfc">Register</Link>
                  </div>
                )}
              </div>
            </div>
          </header>

          {/* Main */}
          <main className="flex-1 max-w-7xl w-full mx-auto px-6 py-8">
            <Outlet />
          </main>

          {/* Footer */}
          <footer className="hdfc-footer">
            © {new Date().getFullYear()} HDFC Bank — Digital KYC Portal. All rights reserved.
          </footer>
        </>
      )}
    </div>
  );
}
